import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <nav className="flex items-center justify-center px-30 py-4 bg-black bg-opacity-80 text-white sticky top-0 z-50">
      <div className="flex space-x-20">
        <Link to="/home" className="text-lg font-medium hover:text-yellow-400">Home</Link>
        <Link to="/game" className="text-lg font-medium hover:text-yellow-400">Game</Link>
        <Link to="/about" className="text-lg font-medium hover:text-yellow-400">About</Link>
      </div>
    </nav>
  );
};

export default Header;
